import {Link} from 'react-router-dom';

export const ManagerNavBar = ()=> {
    return(
        <div>
          <Link to="/">Home</Link>
          <Link to="/pending">Pendind Test-Drives</Link>
          <Link to="/legacy">Administration</Link>
          <Link to="/administrate">Legacy Test-Drive</Link>
        </div>
    );
};
